import React from 'react';
import words from 'App.js'

function TableRow() {
	const rows = prods.map(function(words) {
		return <tr key={words.id}>
		    <td>{props.english}</td>
            <td>{props.transcription}</td>
            <td>{props.russian}</td>
		</tr>;
	});

	return <table>
		<tbody>
			{rows}
		</tbody>
	</table>;
}

export default TableRow;
